[[package]]
name = "alembic"
version = "1.8.1"
description = "A database migration tool for SQLAlchemy."
category = "main"
optional = false
python-versions = ">=3.7"

[package.dependencies]
Mako = "*"
SQLAlchemy = ">=1.3.0"

[package.extras]
tz = ["python-dateutil"]

[[package]]
name = "ata-db-models"
version = "0.0.6"
description = "Database models and migrations for Automating the Ask."
category = "main"
optional = false
python-versions = ">=3.9,<3.10"

[package.dependencies]
alembic = "1.8.1"
boto3 = "1.26.13"
boto3-stubs = {version = "1.26.13", extras = ["ssm"]}
psycopg2 = "2.9.5"
sqlmodel = "0.0.8"

[[package]]
name = "attrs"
version = "22.1.0"
description = "Classes Without Boilerplate"
category = "dev"
optional = false
python-versions = ">=3.5"

[package.extras]
tests_no_zope = ["cloudpickle", "pytest-mypy-plugins", "mypy (>=0.900,!=0.940)", "pytest (>=4.3.0)", "pympler", "hypothesis", "coverage[toml] (>=5.0.2)"]
